import React, { Component } from 'react'
import { Text, View } from 'react-native'
import style from  './style/bottom.css'
export default class Chat_bottom extends Component {
    render() {
        return (
            <View>
                <View className={style.bottom} >

                </View>
            </View>
        )
    }
}
